import React, { useState } from 'react';
import Krangeslider from './rangeslider';

function KrangesliderLadder () {

  const [ value, setValue ] = useState(50);

  return (
    <div class="d-flex justify-content-center my-4">
      <span class="font-weight-bold purple-text mr-2 mt-1">0</span>
        <Krangeslider
          value={value}
          onChange={changeEvent => setValue(changeEvent.target.value)}
        />
      <span class="font-weight-bold purple-text ml-2 mt-1">100</span>
    </div>



  );

};

export default KrangesliderLadder;
